import { Container, Typography, Button } from '@mui/material'
import React from 'react'

const Home = () => {
    return (
        <Container maxWidth='md' sx={{ display: 'flex', flexDirection: 'column', justifyContent: 'center' }}>
            <Typography variant='h4'>Reimagine Your Spaces with AI-Powered Design</Typography>
            <Typography variant='subtitle1'>Transform ideas into stunning architectural and interior designs in seconds. Powered by cutting-edge Stable Diffusion technology.</Typography>
            <Button variant='contained'>Generate Now</Button>
        </Container>
    )
}

export default Home
